import React, { CSSProperties } from "react";

const logoStyle = (style?: CSSProperties): CSSProperties => ({
  width: 50,
  marginRight: "auto",
  marginBottom: 0,
  ...style,
});

interface AJCFLogoProps {
  style?: CSSProperties;
}

const logoSource =
  "data:image/png;base64,\n";

const AJCFLogo = ({ style }: AJCFLogoProps) => (
  <img
    className="ajcf-logo"
    src={logoSource}
    style={logoStyle(style)}
    alt="AJCF logo"
  />
);

export { AJCFLogo };
